import React from "react";
import Video from "../../Asset/React Router Beginners-4.mp4";
import Test from "../../Asset/intro-to-react-router.jpeg";
import Test2 from "../../Asset/Reatjs-Component.jpeg";
import "../VideoCards/VideoCards.scss";

function VideoCards({ videos }) {
  console.log(videos);
  return (
    <div className="videocards">
      <h1 className="videocards__header"> My Videos</h1>
      <div className="videocards__gallery">
        <img
          className="videocards__gallery__clips"
          src={videos[0].image}
          alt="react image"
        />
        <div className="videocards__gallery__info">
          <h4>{videos.tittle}</h4>
          <div className="videocards__gallery__info__container">
            <div>
              <p>rating 2000 </p>
            </div>
            <div>
              <p>reviews important</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default VideoCards;
